import React, { Component } from "react";
import "./navbar.css";

export default class NavBar extends Component {
  render() {
    return (
      <div class="navbar">
        <div class="navbar_h1">
          <h1>WatchIt</h1>
        </div>

        <div class="navbar_right_side">
          <ul class="navList">
            <li class="navbar_h2">
              <h2>Favourites</h2>
            </li>
            <li class="navbar_h2">
              <h2>Leaderboard</h2>
            </li>
            <li class="navbar_h2">
              <h2 class="last">Logout</h2>
            </li>
          </ul>
        </div>
      </div>
    );
  }
}
